An Ecosystem provides a set of coalescers, package scanners, distribution scanners, and repository scanners to Libindex at the time of indexing. Libindex will take the Ecosystem and scan each layer with all provided scanners. When Libindex is ready to coalesce the results of each scanner into an IndexReport the provided coalescer is given the output of the configured scanners. This allows Libindex to segment the input to the coalescing step to particular scanners that a coalescer understands. For instance, if we only wanted a (fictitious) Haskell coalescer to evaluate artifacts returned from a (fictitious) Haskell package and repository scanner we would create an ecosystem similar to: // HaskellScanner returns a configured PackageScanner.
func haskellScanner() indexer.PackageScanner { return nil } // HaskellCoalescer returns a configured Coalescer.
func haskellCoalescer() indexer.Coalescer { return nil } // NewEcosystem provides the set of scanners and coalescers for the haskell
// ecosystem.
func NewEcosystem(ctx context.Context) *indexer.Ecosystem { return &indexer.Ecosystem{ PackageScanners: func(ctx context.Context) ([]indexer.PackageScanner, error) { return []indexer.PackageScanner{haskellScanner()}, nil }, DistributionScanners: func(ctx context.Context) ([]indexer.DistributionScanner, error) { return []indexer.DistributionScanner{}, nil }, RepositoryScanners: func(ctx context.Context) ([]indexer.RepositoryScanner, error) { return []indexer.RepositoryScanner{}, nil }, Coalescer: func(ctx context.Context) (indexer.Coalescer, error) { return haskellCoalescer(), nil }, }
} This ensures that Libindex will only provide Haskell artifacts to the Haskell coalescer and avoid calling the coalescer with rpm packages for example. If your distribution uses an already implemented package manager such as "rpm" or "dpkg", it's likely you will simply add your scanners to the existing ecosystem in one of those packages.

